import styled from 'styled-components';

export default styled.button`
	background-color: #444;
	border: 0px;
	color: #333;
	font-size: 1.3rem;
	font-weight: bold;
	padding: 10px;
	border-radius: 5px;

	&:hover {
		background-color: #DBDBDB;
	}
`;
